import React, { useState, useEffect } from 'react';
import { 
  PlusIcon, 
  PencilIcon, 
  TrashIcon, 
  ClockIcon, 
  UserGroupIcon, 
  XMarkIcon,
  MagnifyingGlassIcon,
  UserPlusIcon,
  UserMinusIcon,
  AcademicCapIcon,
  CheckIcon
} from '@heroicons/react/24/outline';
import toast from 'react-hot-toast';
import axios from 'axios';

// Set up axios defaults
axios.defaults.baseURL = 'http://localhost:5000';

function Schedules() {
  const [schedules, setSchedules] = useState([]);
  const [courses, setCourses] = useState([]);
  const [instructors, setInstructors] = useState([]);
  const [rooms, setRooms] = useState([]);
  const [students, setStudents] = useState([]);
  const [loading, setLoading] = useState(true);
  const [showModal, setShowModal] = useState(false);
  const [editingSchedule, setEditingSchedule] = useState(null);
  const [showEnrollModal, setShowEnrollModal] = useState(false);
  const [selectedSchedule, setSelectedSchedule] = useState(null);
  const [enrollmentData, setEnrollmentData] = useState(null);
  const [enrollmentLoading, setEnrollmentLoading] = useState(false);
  const [searchTerm, setSearchTerm] = useState('');
  const [selectedStudents, setSelectedStudents] = useState([]);
  const [showAddStudents, setShowAddStudents] = useState(false);

  const [formData, setFormData] = useState({
    course_id: '',
    room_id: '',
    day_of_week: 'Monday',
    start_time: '',
    end_time: '',
    academic_year: '2024-2025',
    semester: 'First Semester'
  });

  const daysOfWeek = ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday', 'Sunday'];
  const semesters = ['First Semester', 'Second Semester', 'Summer'];

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      setLoading(true);
      const token = localStorage.getItem('token');

      if (!token) {
        toast.error('Please login to access schedules');
        return;
      }

      const headers = { Authorization: `Bearer ${token}` };

      // Fetch all data in parallel
      const [schedulesRes, coursesRes, instructorsRes, roomsRes, studentsRes] = await Promise.all([
        axios.get('/api/schedules', { headers }),
        axios.get('/api/courses', { headers }),
        axios.get('/api/users?type=instructor', { headers }),
        axios.get('/api/rooms', { headers }),
        axios.get('/api/users?type=student', { headers })
      ]);

      setSchedules(schedulesRes.data.schedules || []);
      setCourses(coursesRes.data.courses || []);
      setInstructors(instructorsRes.data.users || []);
      setRooms(roomsRes.data.rooms || []);
      setStudents(studentsRes.data.users || []);

    } catch (error) {
      /* eslint-disable */console.error(...oo_tx(`795115386_83_6_83_50_11`,'Error fetching data:', error));
      if (error.response?.status === 401) {
        toast.error('Session expired. Please login again.');
        localStorage.removeItem('token');
        window.location.href = '/login';
      } else {
        toast.error('Failed to load data');
      }
    } finally {
      setLoading(false);
    }
  };

  const fetchEnrollmentData = async (scheduleId) => {
    try {
      setEnrollmentLoading(true);
      const token = localStorage.getItem('token');
      const headers = { Authorization: `Bearer ${token}` };

      const response = await axios.get(`/api/enrollment/schedule/${scheduleId}`, { headers });
      setEnrollmentData(response.data);
    } catch (error) {
      /* eslint-disable */console.error(...oo_tx(`795115386_105_6_105_61_11`,'Error fetching enrollment data:', error));
      toast.error('Failed to load enrollment data');
    } finally {
      setEnrollmentLoading(false);
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const token = localStorage.getItem('token');
      const headers = { Authorization: `Bearer ${token}` };

      if (editingSchedule) {
        // Update existing schedule
        await axios.put(`/api/schedules/${editingSchedule.SCHEDULEID}`, formData, { headers });
        toast.success('Schedule updated successfully');
      } else {
        // Create new schedule
        await axios.post('/api/schedules', formData, { headers });
        toast.success('Schedule created successfully');
      }

      await fetchData(); // Refresh data
      setShowModal(false);
      resetForm();
      setEditingSchedule(null);
    } catch (error) {
      /* eslint-disable */console.error(...oo_tx(`795115386_133_6_133_52_11`,'Error saving schedule:', error));
      if (error.response?.data?.message) {
        toast.error(error.response.data.message);
      } else {
        toast.error('Failed to save schedule');
      }
    }
  };

  const resetForm = () => {
    setFormData({
      course_id: '',
      room_id: '',
      day_of_week: 'Monday',
      start_time: '',
      end_time: '',
      academic_year: '2024-2025',
      semester: 'First Semester'
    });
  };

  const handleEdit = (schedule) => {
    setEditingSchedule(schedule);
    setFormData({
      course_id: schedule.COURSEID || '',
      room_id: schedule.ROOMID || '',
      day_of_week: schedule.DAYOFWEEK || 'Monday',
      start_time: schedule.STARTTIME ? schedule.STARTTIME.substring(0, 5) : '',
      end_time: schedule.ENDTIME ? schedule.ENDTIME.substring(0, 5) : '',
      academic_year: schedule.ACADEMICYEAR || '2024-2025',
      semester: schedule.SEMESTER || 'First Semester'
    });
    setShowModal(true);
  };

  const handleDelete = async (scheduleId) => {
    if (window.confirm('Are you sure you want to delete this schedule?')) {
      try {
        const token = localStorage.getItem('token');
        const headers = { Authorization: `Bearer ${token}` };

        await axios.delete(`/api/schedules/${scheduleId}`, { headers });
        await fetchData(); // Refresh data
        toast.success('Schedule deleted successfully');
      } catch (error) {
        /* eslint-disable */console.error(...oo_tx(`795115386_178_8_178_56_11`,'Error deleting schedule:', error));
        toast.error('Failed to delete schedule');
      }
    }
  };

  const handleManageEnrollment = async (schedule) => {
    setSelectedSchedule(schedule);
    setShowEnrollModal(true);
    setSearchTerm('');
    setSelectedStudents([]);
    setShowAddStudents(false);
    await fetchEnrollmentData(schedule.SCHEDULEID);
  };

  const handleEnrollStudents = async () => {
    if (selectedStudents.length === 0) {
      toast.error('Please select students to enroll');
      return;
    }

    try {
      const token = localStorage.getItem('token');
      const headers = { Authorization: `Bearer ${token}` };

      const response = await axios.post(
        `/api/enrollment/schedule/${selectedSchedule.SCHEDULEID}/enroll`,
        { studentIds: selectedStudents },
        { headers }
      );

      if (response.data.errors && response.data.errors.length > 0) {
        toast.error(`Some enrollments failed: ${response.data.errors.slice(0, 2).join(', ')}`);
      } else {
        toast.success(response.data.message);
      }

      setSelectedStudents([]);
      setShowAddStudents(false);
      await fetchEnrollmentData(selectedSchedule.SCHEDULEID);
    } catch (error) {
      /* eslint-disable */console.error(...oo_tx(`795115386_219_6_219_55_11`,'Error enrolling students:', error));
      toast.error('Failed to enroll students');
    }
  };

  const handleRemoveStudent = async (studentId, studentName) => {
    if (!window.confirm(`Are you sure you want to remove ${studentName} from this course?`)) {
      return;
    }

    try {
      const token = localStorage.getItem('token');
      const headers = { Authorization: `Bearer ${token}` };

      await axios.delete(
        `/api/enrollment/schedule/${selectedSchedule.SCHEDULEID}/student/${studentId}`,
        { headers }
      );

      toast.success('Student removed successfully');
      await fetchEnrollmentData(selectedSchedule.SCHEDULEID);
    } catch (error) {
      /* eslint-disable */console.error(...oo_tx(`795115386_241_6_241_53_11`,'Error removing student:', error));
      toast.error('Failed to remove student');
    }
  };

  const handleStudentSelection = (studentId) => {
    setSelectedStudents(prev => 
      prev.includes(studentId) 
        ? prev.filter(id => id !== studentId)
        : [...prev, studentId]
    );
  };

  const formatTime = (time) => {
    if (!time) return '';
    const [hours, minutes] = time.split(':');
    const hour = parseInt(hours);
    const ampm = hour >= 12 ? 'PM' : 'AM';
    const displayHour = hour % 12 || 12;
    return `${displayHour}:${minutes} ${ampm}`;
  };

  const filteredAvailableStudents = enrollmentData?.available?.filter(student =>
    student.student_name.toLowerCase().includes(searchTerm.toLowerCase()) ||
    student.EMAIL.toLowerCase().includes(searchTerm.toLowerCase()) ||
    student.STUDENTID?.toLowerCase().includes(searchTerm.toLowerCase())
  ) || [];

  const filteredEnrolledStudents = enrollmentData?.enrolled?.filter(student =>
    student.student_name.toLowerCase().includes(searchTerm.toLowerCase()) ||
    student.EMAIL.toLowerCase().includes(searchTerm.toLowerCase()) ||
    student.STUDENTID?.toLowerCase().includes(searchTerm.toLowerCase())
  ) || [];

  if (loading) {
    return (
      <div className="flex items-center justify-center h-64">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-600"></div>
      </div>
    );
  }

  return (
    <div className="space-y-6">
      {/* Header */}
      <div className="flex justify-between items-center">
        <div>
          <h1 className="text-2xl font-bold text-gray-900">Schedule Management</h1>
          <p className="text-gray-600">Manage class schedules, subjects, and enrollment</p>
        </div>
        <button
          onClick={() => setShowModal(true)}
          className="inline-flex items-center px-4 py-2 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-blue-600 hover:bg-blue-700"
        >
          <PlusIcon className="h-4 w-4 mr-2" />
          Add Schedule
        </button>
      </div>

      {/* Schedule Grid */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {schedules.map((schedule) => (
          <div key={schedule.SCHEDULEID} className="bg-white rounded-lg shadow border border-gray-200 p-6">
            <div className="flex justify-between items-start mb-4">
              <div>
                <h3 className="text-lg font-semibold text-gray-900">{schedule.course_code}</h3>
                <p className="text-sm text-gray-600">{schedule.course_name}</p>
              </div>
              <div className="flex space-x-2">
                <button
                  onClick={() => handleEdit(schedule)}
                  className="text-gray-400 hover:text-blue-600"
                >
                  <PencilIcon className="h-4 w-4" />
                </button>
                <button
                  onClick={() => handleDelete(schedule.SCHEDULEID)}
                  className="text-gray-400 hover:text-red-600"
                >
                  <TrashIcon className="h-4 w-4" />
                </button>
              </div>
            </div>

            <div className="space-y-2 mb-4">
              <div className="flex items-center text-sm text-gray-600">
                <ClockIcon className="h-4 w-4 mr-2" />
                {schedule.DAYOFWEEK}  {formatTime(schedule.STARTTIME)} - {formatTime(schedule.ENDTIME)}
              </div>
              <div className="text-sm text-gray-600">
                <strong>Instructor:</strong> {schedule.instructor_name || 'Not assigned'}
              </div>
              <div className="text-sm text-gray-600">
                <strong>Room:</strong> {schedule.room_number} - {schedule.room_name}
              </div>
              <div className="text-sm text-gray-600">
                <strong>Semester:</strong> {schedule.SEMESTER} ({schedule.ACADEMICYEAR})
              </div>
            </div>

            <button
              onClick={() => handleManageEnrollment(schedule)}
              className="w-full inline-flex items-center justify-center px-3 py-2 border border-gray-300 shadow-sm text-sm leading-4 font-medium rounded-md text-gray-700 bg-white hover:bg-gray-50"
            >
              <UserGroupIcon className="h-4 w-4 mr-2" />
              Manage Enrollment
            </button>
          </div>
        ))}
      </div>

      {schedules.length === 0 && !loading && (
        <div className="text-center py-12">
          <ClockIcon className="mx-auto h-12 w-12 text-gray-400" />
          <h3 className="mt-2 text-sm font-medium text-gray-900">No schedules</h3>
          <p className="mt-1 text-sm text-gray-500">Get started by creating a new schedule.</p>
          <div className="mt-6">
            <button
              onClick={() => setShowModal(true)}
              className="inline-flex items-center px-4 py-2 border border-transparent shadow-sm text-sm font-medium rounded-md text-white bg-blue-600 hover:bg-blue-700"
            >
              <PlusIcon className="h-4 w-4 mr-2" />
              Add Schedule
            </button>
          </div>
        </div>
      )}

      {/* Add/Edit Schedule Modal */}
      {showModal && (
        <div className="fixed inset-0 bg-gray-600 bg-opacity-50 overflow-y-auto h-full w-full z-50">
          <div className="relative top-20 mx-auto p-5 border w-96 shadow-lg rounded-md bg-white">
            <div className="mt-3">
              <h3 className="text-lg font-medium text-gray-900 mb-4">
                {editingSchedule ? 'Edit Schedule' : 'Add New Schedule'}
              </h3>
              <form onSubmit={handleSubmit} className="space-y-4">
                <div>
                  <label className="block text-sm font-medium text-gray-700">Course</label>
                  <select
                    value={formData.course_id}
                    onChange={(e) => setFormData({ ...formData, course_id: e.target.value })}
                    className="mt-1 block w-full border border-gray-300 rounded-md px-3 py-2"
                    required
                  >
                    <option value="">Select Course</option>
                    {courses.map(course => (
                      <option key={course.COURSEID} value={course.COURSEID}>
                        {course.COURSECODE} - {course.COURSENAME}
                      </option>
                    ))}
                  </select>
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-700">Room</label>
                  <select
                    value={formData.room_id}
                    onChange={(e) => setFormData({ ...formData, room_id: e.target.value })}
                    className="mt-1 block w-full border border-gray-300 rounded-md px-3 py-2"
                    required
                  >
                    <option value="">Select Room</option>
                    {rooms.map(room => (
                      <option key={room.ROOMID} value={room.ROOMID}>
                        {room.ROOMNUMBER} - {room.ROOMNAME}
                      </option>
                    ))}
                  </select>
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-700">Day of Week</label>
                  <select
                    value={formData.day_of_week}
                    onChange={(e) => setFormData({ ...formData, day_of_week: e.target.value })}
                    className="mt-1 block w-full border border-gray-300 rounded-md px-3 py-2"
                    required
                  >
                    {daysOfWeek.map(day => (
                      <option key={day} value={day}>{day}</option>
                    ))}
                  </select>
                </div>

                <div className="grid grid-cols-2 gap-4">
                  <div>
                    <label className="block text-sm font-medium text-gray-700">Start Time</label>
                    <input
                      type="time"
                      value={formData.start_time}
                      onChange={(e) => setFormData({ ...formData, start_time: e.target.value })}
                      className="mt-1 block w-full border border-gray-300 rounded-md px-3 py-2"
                      required
                    />
                  </div>
                  <div>
                    <label className="block text-sm font-medium text-gray-700">End Time</label>
                    <input
                      type="time"
                      value={formData.end_time}
                      onChange={(e) => setFormData({ ...formData, end_time: e.target.value })}
                      className="mt-1 block w-full border border-gray-300 rounded-md px-3 py-2"
                      required
                    />
                  </div>
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-700">Academic Year</label>
                  <input
                    type="text"
                    value={formData.academic_year}
                    onChange={(e) => setFormData({ ...formData, academic_year: e.target.value })}
                    className="mt-1 block w-full border border-gray-300 rounded-md px-3 py-2"
                    placeholder="2024-2025"
                    required
                  />
                </div>

                <div>
                  <label className="block text-sm font-medium text-gray-700">Semester</label>
                  <select
                    value={formData.semester}
                    onChange={(e) => setFormData({ ...formData, semester: e.target.value })}
                    className="mt-1 block w-full border border-gray-300 rounded-md px-3 py-2"
                    required
                  >
                    {semesters.map(semester => (
                      <option key={semester} value={semester}>{semester}</option>
                    ))}
                  </select>
                </div>

                <div className="flex justify-end space-x-3 pt-4">
                  <button
                    type="button"
                    onClick={() => {
                      setShowModal(false);
                      setEditingSchedule(null);
                      resetForm();
                    }}
                    className="px-4 py-2 border border-gray-300 rounded-md text-sm font-medium text-gray-700 hover:bg-gray-50"
                  >
                    Cancel
                  </button>
                  <button
                    type="submit"
                    className="px-4 py-2 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-blue-600 hover:bg-blue-700"
                  >
                    {editingSchedule ? 'Update' : 'Create'}
                  </button>
                </div>
              </form>
            </div>
          </div>
        </div>
      )}

      {/* Enrollment Management Modal */}
      {showEnrollModal && selectedSchedule && (
        <div className="fixed inset-0 bg-gray-600 bg-opacity-50 overflow-y-auto h-full w-full z-50">
          <div className="relative top-10 mx-auto p-6 border max-w-6xl shadow-lg rounded-md bg-white my-8">
            <div className="flex justify-between items-center mb-6">
              <div>
                <h3 className="text-xl font-semibold text-gray-900">
                  Manage Enrollment - {selectedSchedule.course_code}
                </h3>
                <p className="text-sm text-gray-600">
                  {selectedSchedule.course_name}  {selectedSchedule.instructor_name}
                </p>
                {enrollmentData && (
                  <p className="text-sm text-blue-600 mt-1">
                    {enrollmentData.statistics.totalEnrolled} enrolled  {enrollmentData.statistics.totalAvailable} available
                  </p>
                )}
              </div>
              <button
                onClick={() => setShowEnrollModal(false)}
                className="text-gray-400 hover:text-gray-600"
              >
                <XMarkIcon className="h-6 w-6" />
              </button>
            </div>

            {enrollmentLoading ? (
              <div className="flex items-center justify-center h-64">
                <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-600"></div>
              </div>
            ) : enrollmentData ? (
              <div className="grid grid-cols-1 lg:grid-cols-2 gap-6">
                {/* Enrolled Students */}
                <div className="bg-gray-50 rounded-lg p-4">
                  <div className="flex justify-between items-center mb-4">
                    <h4 className="text-lg font-medium text-gray-900">
                      Enrolled Students ({enrollmentData.enrolled.length})
                    </h4>
                  </div>

                  <div className="mb-4">
                    <div className="relative">
                      <MagnifyingGlassIcon className="h-5 w-5 absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-400" />
                      <input
                        type="text"
                        placeholder="Search enrolled students..."
                        value={searchTerm}
                        onChange={(e) => setSearchTerm(e.target.value)}
                        className="w-full pl-10 pr-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-1 focus:ring-blue-500"
                      />
                    </div>
                  </div>

                  <div className="max-h-96 overflow-y-auto space-y-2">
                    {filteredEnrolledStudents.length === 0 ? (
                      <p className="text-gray-500 text-center py-8">No enrolled students found</p>
                    ) : (
                      filteredEnrolledStudents.map((student) => (
                        <div key={student.USERID} className="bg-white rounded-lg p-3 border border-gray-200">
                          <div className="flex justify-between items-center">
                            <div className="flex items-center space-x-3">
                              <div className="flex-shrink-0 h-8 w-8 bg-green-100 rounded-full flex items-center justify-center">
                                <AcademicCapIcon className="h-4 w-4 text-green-600" />
                              </div>
                              <div>
                                <div className="text-sm font-medium text-gray-900">{student.student_name}</div>
                                <div className="text-xs text-gray-500">
                                  {student.STUDENTID}  Year {student.YEARLEVEL}  {student.DEPARTMENT}
                                </div>
                                <div className="text-xs text-gray-400">{student.EMAIL}</div>
                              </div>
                            </div>
                            <button
                              onClick={() => handleRemoveStudent(student.USERID, student.student_name)}
                              className="text-red-600 hover:text-red-800 p-1"
                              title="Remove student"
                            >
                              <UserMinusIcon className="h-4 w-4" />
                            </button>
                          </div>
                        </div>
                      ))
                    )}
                  </div>
                </div>

                {/* Available Students */}
                <div className="bg-gray-50 rounded-lg p-4">
                  <div className="flex justify-between items-center mb-4">
                    <h4 className="text-lg font-medium text-gray-900">
                      Available Students ({enrollmentData.available.length})
                    </h4>
                    {selectedStudents.length > 0 && (
                      <div className="flex space-x-2">
                        <span className="text-sm text-gray-600">
                          {selectedStudents.length} selected
                        </span>
                        <button
                          onClick={handleEnrollStudents}
                          className="inline-flex items-center px-3 py-1 text-xs font-medium text-white bg-blue-600 rounded-md hover:bg-blue-700"
                        >
                          <UserPlusIcon className="h-3 w-3 mr-1" />
                          Enroll Selected
                        </button>
                      </div>
                    )}
                  </div>

                  <div className="mb-4">
                    <div className="relative">
                      <MagnifyingGlassIcon className="h-5 w-5 absolute left-3 top-1/2 transform -translate-y-1/2 text-gray-400" />
                      <input
                        type="text"
                        placeholder="Search available students..."
                        value={searchTerm}
                        onChange={(e) => setSearchTerm(e.target.value)}
                        className="w-full pl-10 pr-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-1 focus:ring-blue-500"
                      />
                    </div>
                  </div>

                  <div className="max-h-96 overflow-y-auto space-y-2">
                    {filteredAvailableStudents.length === 0 ? (
                      <p className="text-gray-500 text-center py-8">No available students found</p>
                    ) : (
                      filteredAvailableStudents.map((student) => (
                        <div key={student.USERID} className="bg-white rounded-lg p-3 border border-gray-200">
                          <div className="flex justify-between items-center">
                            <div className="flex items-center space-x-3">
                              <div className="flex-shrink-0 h-8 w-8 bg-gray-100 rounded-full flex items-center justify-center">
                                <AcademicCapIcon className="h-4 w-4 text-gray-600" />
                              </div>
                              <div>
                                <div className="text-sm font-medium text-gray-900">{student.student_name}</div>
                                <div className="text-xs text-gray-500">
                                  {student.STUDENTID}  Year {student.YEARLEVEL}  {student.DEPARTMENT}
                                </div>
                                <div className="text-xs text-gray-400">{student.EMAIL}</div>
                              </div>
                            </div>
                            <button
                              onClick={() => handleStudentSelection(student.USERID)}
                              className={`p-1 rounded ${
                                selectedStudents.includes(student.USERID)
                                  ? 'text-blue-600 bg-blue-100'
                                  : 'text-gray-400 hover:text-blue-600'
                              }`}
                              title={selectedStudents.includes(student.USERID) ? 'Deselect' : 'Select to enroll'}
                            >
                              {selectedStudents.includes(student.USERID) ? (
                                <CheckIcon className="h-4 w-4" />
                              ) : (
                                <UserPlusIcon className="h-4 w-4" />
                              )}
                            </button>
                          </div>
                        </div>
                      ))
                    )}
                  </div>
                </div>
              </div>
            ) : (
              <div className="text-center py-8">
                <p className="text-gray-500">Failed to load enrollment data</p>
                <button
                  onClick={() => fetchEnrollmentData(selectedSchedule.SCHEDULEID)}
                  className="mt-2 text-blue-600 hover:text-blue-800"
                >
                  Retry
                </button>
              </div>
            )}

            <div className="mt-6 flex justify-end">
              <button
                onClick={() => setShowEnrollModal(false)}
                className="px-4 py-2 border border-gray-300 rounded-md text-sm font-medium text-gray-700 hover:bg-gray-50"
              >
                Close
              </button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
